import "./Navbar.css";

function Navbar() {
  return (
    <header className="navbar">
      <h1>Dashboard</h1>
      <div className="nav-actions">
        <span>Pratham</span>
        <button>Logout</button>
      </div>
    </header>
  );
}

export default Navbar;
